import React, { useState, useEffect } from 'react';


const RestuList = () => {
    const [data, setData] = useState();

    const getData = async () => {
        const Response = await fetch('http://localhost:3000/restaurant');
        const result = await Response.json();
        console.log(result);
        setData(result);
    };


    useEffect(() => {
        getData();
    }, []);



    return (
        <>
            <section className="container">
                <div className="row row-cols-8 mx-auto my-5">
                  <h2 className="text-center">Restaurant List</h2>
                </div>
                <div className="row">
                    <div className="col-md-10 mx-auto">
                      <table className="table table-striped">
                        <thead>
                              <tr>
                                  <th className="text-bold">Restu Id</th>
                                  <th className="text-bold">Name</th>
                                  <th className="text-bold">Location</th>
                                  <th className="text-bold">Rating</th>
                                  <th className="text-bold">Email</th>
                              </tr>
                        </thead>
                            {
                            data.map((elem) => {
                                return(
                                <tbody className="text">
                                    <td> {elem.id} </td>
                                    <td> {elem.name} </td>
                                    <td> {elem.address} </td>
                                    <td> {elem.rating} </td>
                                    <td> {elem.email} </td>
                                <tr>
                                </tr>  
                                </tbody>
                                        )
                                })
                            }
                      </table>
                    </div>
                </div>
            </section>
        </>
    )
}

export default RestuList;
